import React from "react";

const MuseumDetailPage = () => {
  return (
    <div>
      <h1>Museum Details</h1>
      <p>
        Explore the details of this museum, including history, artifacts, and
        special exhibitions.
      </p>
    </div>
  );
};

export default MuseumDetailPage;
